import Excursion from './Excursion'

const Excursions = ({excursionList}) => {

    return (
       <div className='test'>
        {excursionList.map((exc) => (
            <Excursion key={exc.id} excursion={exc.title} />
        ))}
        </div>
    )
}

export default Excursions
